import React from 'react';
import Editor from './components/editor/editor'; // Adjust path as necessary

function App() {
  const [value, setValue] = React.useState("console.log('Hello World!');\n".repeat(10));

  // Example special lines
  const specialLines = [
    { line: 2, color: 'red' },
    { line: 4, color: 'blue' }
  ];

  const handleEditorChange = (newValue) => {
    setValue(newValue);
  };

  return (
    <div>
      <Editor
        value={value}
        onChange={handleEditorChange}
        specialLines={specialLines}
      />
    </div>
  );
}


